import React, { Component } from 'react';

class Button extends Component {
  state = {
    message: ''
  };

  render() {
    return (
      <>
        <button
          onClick={() => {
            this.props.reloadPopsicles();
          }}
        >
          My Button
        </button>
      </>
    );
  }
}

export default Button;
